import React from 'react';
import './App.css';

function App() {
  return (
    <>
      <div id="left-menu">
        <h1 className="logo">
          <a href="#">NAMI</a>
        </h1>
      </div>
      <div id="contents">
        컨텐츠
      </div>
    </>
  );
}

export default App;
